    false,nt"url": null,nt"notes": "The gravity station data (18,461 records)
    were compiled by the U. S. Geological Survey. This data base was received on February
    23, 1993. Principal gravity parameters include observed gravity, Complete Bouguer
    Gravity anomalies and Free-air anomalies. The observed gravity values are believed
    referenced to the International Gravity Standardization Net 1971 (IGSN 71). It is
    also believed the gravity anomaly computation uses the Geodetic Reference System
    1967 (GRS 67) theoretical gravity formula.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
